/* Procedure structure for procedure `dashboard5` */

/*!50003 DROP PROCEDURE IF EXISTS  `dashboard5` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`admin`@`%` PROCEDURE `dashboard5`(IN monthOrder INT, yearOrder INT)
BEGIN

SET TRANSACTION ISOLATION LEVEL READ COMMITTED;

SELECT
	RANK() OVER (ORDER BY aa.Sales DESC) AS 'Rank',
	aa.Product,
    FORMAT(aa.Sales,2) AS 'Sales',
    FORMAT((aa.Sales / bb.TotalSales) * 100,2) AS 'SalesRate'
FROM
	(
		SELECT
			MONTH(DateOrdered) AS 'Month',
            YEAR(DateOrdered) AS 'Year',
			Product,
			SUM(CodAmount) AS 'Sales'
		FROM
			topyougo.orders
		WHERE
			MONTH(DateOrdered) = monthOrder
			AND
			YEAR(DateOrdered) = yearOrder
		GROUP BY
			Product,
            MONTH(DateOrdered),
            YEAR(DateOrdered)
	) aa
LEFT JOIN
	(
		SELECT
			MONTH(DateOrdered) AS 'Month',
            YEAR(DateOrdered) AS 'Year',
			SUM(CodAmount) AS 'TotalSales'
		FROM
			topyougo.orders
		WHERE
			MONTH(DateOrdered) = monthOrder
			AND
			YEAR(DateOrdered) = yearOrder
		GROUP BY
			MONTH(DateOrdered),
            YEAR(DateOrdered)
	) bb
ON
	aa.`Month` = bb.`Month`
    AND
	aa.`Year` = bb.`Year`
ORDER BY
	aa.Sales DESC
LIMIT 10;

END */$$
DELIMITER ;

/* Procedure structure for procedure `dashboard1` */

/*!50003 DROP PROCEDURE IF EXISTS  `dashboard1` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`admin`@`%` PROCEDURE `dashboard1`(IN monthOrder INT, yearOrder INT)
BEGIN

SET TRANSACTION ISOLATION LEVEL READ COMMITTED;

SELECT
	1 AS ID,
	`Month`,
    FORMAT(`SalesGoal`,2) AS 'SalesGoal',
    FORMAT(`Sales`,2) AS 'Sales',
    ROUND(IFNULL((`Sales` / `SalesGoal`) * 100.00,0),2) AS 'SalesPercentage',
    FORMAT(`Sales`,2) AS 'ShippedGoal',
    FORMAT(`Shipped`,2) AS 'Shipped',
    ROUND(IFNULL((`Shipped` / `Sales`) * 100.00,0),2) AS 'ShippingPercentage',
    FORMAT(`Shipped`,2) AS 'DeliveredGoal',
    FORMAT(`Delivered`,2) AS 'Delivered',
    ROUND(IFNULL((`Delivered` / `Shipped`) * 100.00,0),2) AS 'DeliveredPercentage',
    FORMAT(`Delivered`,2) AS 'PaidGoal',
    FORMAT(`Paid`,2) AS 'Paid',
    ROUND(IFNULL((`Paid` / `Delivered`) * 100.00,0),2) AS 'PaidPercentage',
    DATE_FORMAT(NOW(), "%M %d %Y %r") AS 'CurrentDateTime'
FROM
	(
		SELECT
			aa.`Month`,
			IFNULL(aa.`SalesGoal`,0) AS `SalesGoal`,
			IFNULL(aa.`Sales`,0) AS `Sales`,
			IFNULL(bb.`Shipped`,0) AS `Shipped`,
            IFNULL(cc.`Delivered`,0) AS `Delivered`,
            IFNULL(dd.`Paid`,0) AS `Paid`
		FROM
			(
				SELECT
                    YEAR(DateOrdered) AS 'Year',
					MONTHNAME(DateOrdered) AS 'Month',
					CONVERT('15000000',DECIMAL) AS 'SalesGoal',
					SUM(CodAmount) AS 'Sales'
				FROM
					topyougo.orders
				WHERE
					MONTH(DateOrdered) = monthOrder
                    AND
                    YEAR(DateOrdered) = yearOrder
				GROUP BY
					YEAR(DateOrdered),
					MONTHNAME(DateOrdered)
			) aa
		LEFT JOIN
			(
				SELECT
                    YEAR(DateOrdered) AS 'Year',
					MONTHNAME(DateOrdered) AS 'Month',
					SUM(OrderAmount) AS 'Shipped'
				FROM
					topyougo.orders
				WHERE
					OrderStatus = 'SHIPPED'
					AND
					MONTH(DateOrdered) = monthOrder
                    AND
                    YEAR(DateOrdered) = yearOrder
				GROUP BY
					YEAR(DateOrdered),
					MONTHNAME(DateOrdered)
			) bb
		ON	
			aa.`Month` = bb.`Month`
		LEFT JOIN
			(
				SELECT
                    YEAR(DateOrdered) AS 'Year',
					MONTHNAME(DateOrdered) AS 'Month',
					SUM(OrderAmount) AS 'Delivered'
				FROM
					topyougo.orders
				WHERE
					OrderStatus = 'DELIVERED'
					AND
					MONTH(DateOrdered) = monthOrder
                    AND
                    YEAR(DateOrdered) = yearOrder
				GROUP BY
					YEAR(DateOrdered),
					MONTHNAME(DateOrdered)
			) cc
		ON	
			aa.`Month` = cc.`Month`
		LEFT JOIN
			(
				SELECT
                    YEAR(DateOrdered) AS 'Year',
					MONTHNAME(DateOrdered) AS 'Month',
					SUM(OrderAmount) AS 'Paid'
				FROM
					topyougo.orders
				WHERE
					OrderStatus = 'PAID'
					AND
					MONTH(DateOrdered) = monthOrder
                    AND
                    YEAR(DateOrdered) = yearOrder
				GROUP BY
					YEAR(DateOrdered),
					MONTHNAME(DateOrdered)
			) dd
		ON	
			aa.`Month` = dd.`Month`
    ) aa;

END */$$
DELIMITER ;

/* Procedure structure for procedure `dashboard3` */

/*!50003 DROP PROCEDURE IF EXISTS  `dashboard3` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`admin`@`%` PROCEDURE `dashboard3`(IN monthOrder INT, yearOrder INT)
BEGIN

SET TRANSACTION ISOLATION LEVEL READ COMMITTED;

SELECT
	aa.`Month`,
    aa.`Year`,
    FORMAT(IFNULL((aa.Sales1 / bb.Sales2) * 100,0),2) AS 'RTS_Projection',
    FORMAT(IFNULL((aa.Sales1 / ee.Sales3),0),2) AS 'RTS_Rate',
    FORMAT(IFNULL((aa.Sales1 * ((dd.TotalSales / cc.TotalOrders))),0),2) AS 'RTS_Value',
    FORMAT(IFNULL((aa.Sales1 * 110),0),2) AS 'RS_Loss',
    0.00 AS 'D_Gain'
FROM
	(
		SELECT
			MONTH(DateOrdered) AS 'Month',
            YEAR(DateOrdered) AS 'Year',
			SUM(CodAmount) AS 'Sales1'
		FROM
			topyougo.orders
		WHERE
			OrderStatus IN ('RTS','RRTS')
			AND
			MONTH(DateOrdered) = monthOrder
			AND
			YEAR(DateOrdered) = yearOrder
		GROUP BY
			MONTH(DateOrdered),
			YEAR(DateOrdered)
    ) aa
LEFT JOIN
	(
		SELECT
			MONTH(DateOrdered) AS 'Month',
            YEAR(DateOrdered) AS 'Year',
			SUM(CodAmount) AS 'Sales2'
		FROM
			topyougo.orders
		WHERE
			OrderStatus IN ('RTS','RRTS','PAID','DELIVERED','RESHIPPED','ODZ','UNTRACEABLE')
			AND
			MONTH(DateOrdered) = monthOrder
			AND
			YEAR(DateOrdered) = yearOrder
		GROUP BY
			MONTH(DateOrdered),
			YEAR(DateOrdered)
    ) bb
ON
	aa.`Month` = bb.`Month`
    AND
	aa.`Year` = bb.`Year`
LEFT JOIN
	(
		SELECT
			MONTH(DateOrdered) AS 'Month',
            YEAR(DateOrdered) AS 'Year',
			COUNT(DISTINCT CONCAT(OrderNo, Product)) AS 'TotalOrders'
		FROM
			topyougo.orders
		WHERE
			MONTH(DateOrdered) = monthOrder
			AND
			YEAR(DateOrdered) = yearOrder
		GROUP BY
			MONTH(DateOrdered),
			YEAR(DateOrdered)
    ) cc
ON
	aa.`Month` = cc.`Month`
    AND
	aa.`Year` = cc.`Year`
LEFT JOIN
	(
		SELECT
			MONTH(DateOrdered) AS 'Month',
            YEAR(DateOrdered) AS 'Year',
			SUM(CodAmount) AS 'TotalSales'
		FROM
			topyougo.orders
		WHERE
			MONTH(DateOrdered) = monthOrder
			AND
			YEAR(DateOrdered) = yearOrder
		GROUP BY
			MONTH(DateOrdered),
			YEAR(DateOrdered)
    ) dd
ON
	aa.`Month` = dd.`Month`
    AND
	aa.`Year` = dd.`Year`
LEFT JOIN
	(
		SELECT
			MONTH(DateOrdered) AS 'Month',
            YEAR(DateOrdered) AS 'Year',
			SUM(CodAmount) AS 'Sales3'
		FROM
			topyougo.orders
		WHERE
			OrderStatus IN ('RTS','RRTS','SHIPPED','PAID','DELIVERED','RESHIPPED','ODZ','UNTRACEABLE')
			AND
			MONTH(DateOrdered) = monthOrder
			AND
			YEAR(DateOrdered) = yearOrder
		GROUP BY
			MONTH(DateOrdered),
			YEAR(DateOrdered)
    ) ee
ON
	aa.`Month` = ee.`Month`
    AND
	aa.`Year` = ee.`Year`;

END */$$
DELIMITER ;

/* Procedure structure for procedure `dashboard4` */

/*!50003 DROP PROCEDURE IF EXISTS  `dashboard4` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`admin`@`%` PROCEDURE `dashboard4`(IN monthOrder INT, yearOrder INT)
BEGIN

SET TRANSACTION ISOLATION LEVEL READ COMMITTED;

SELECT
	aa.*,
    FORMAT(IFNULL(bb.TotalOrders,0),0) AS TotalOrders
FROM
	(
		SELECT
			MONTH(DateOrdered) AS 'Month',
            YEAR(DateOrdered) AS 'Year',
			OrderStatus,
			FORMAT(COUNT(DISTINCT CONCAT(OrderNo, Product)),0) AS 'Count'
		FROM
			topyougo.orders
		WHERE
			MONTH(DateOrdered) = monthOrder
			AND
			YEAR(DateOrdered) = yearOrder
		GROUP BY
			OrderStatus,
			MONTH(DateOrdered),
			YEAR(DateOrdered)
	) aa
LEFT JOIN
	(
		SELECT
			MONTH(DateOrdered) AS 'Month',
            YEAR(DateOrdered) AS 'Year',
			COUNT(DISTINCT CONCAT(OrderNo, Product)) AS 'TotalOrders'
		FROM
			topyougo.orders
		WHERE
			MONTH(DateOrdered) = monthOrder
			AND
			YEAR(DateOrdered) = yearOrder
		GROUP BY
			MONTH(DateOrdered),
			YEAR(DateOrdered)
    ) bb
ON
	aa.`Month` = bb.`Month`
    AND
	aa.`Year` = bb.`Year`;
    
END */$$
