/* Procedure structure for procedure `dashboard2` */

/*!50003 DROP PROCEDURE IF EXISTS  `dashboard2` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`admin`@`%` PROCEDURE `dashboard2`(IN monthOrder INT, yearOrder INT)
BEGIN

SET TRANSACTION ISOLATION LEVEL READ UNCOMMITTED;

SELECT
	aa.*,
    bb.TotalOrders,
    FORMAT(IFNULL((aa.Amount / bb.TotalOrders),0),2) AS 'CaptureRate',
    FORMAT(IFNULL((cc.DailySales / dd.DailyOrders),0),2) AS 'ADS',
    FORMAT(IFNULL((ee.ActualSales / bb.TotalOrders),0),2) AS 'AOV',
    FORMAT(IFNULL((ff.TotalSales / bb.TotalOrders),0),2) AS 'ACPP',
    0.00 AS 'ROAS'
FROM
	(
		SELECT
			MONTH(DateOrdered) AS 'Month',
            YEAR(DateOrdered) AS 'Year',
			SUM(CodAmount) AS 'Amount'
		FROM
			topyougo.orders
		WHERE
			OrderStatus IN ('FOR_PACKING','SHIPPED','PAID','DELIVERED')
			AND
			MONTH(DateOrdered) = monthOrder
			AND
			YEAR(DateOrdered) = yearOrder
		GROUP BY
			MONTH(DateOrdered),
			YEAR(DateOrdered)
    ) aa
LEFT JOIN
	(
		SELECT
			MONTH(DateOrdered) AS 'Month',
            YEAR(DateOrdered) AS 'Year',
			COUNT(DISTINCT CONCAT(OrderNo, Product)) AS 'TotalOrders'
		FROM
			topyougo.orders
		WHERE
			MONTH(DateOrdered) = monthOrder
			AND
			YEAR(DateOrdered) = yearOrder
		GROUP BY
			MONTH(DateOrdered),
			YEAR(DateOrdered)
    ) bb
ON
	aa.`Month` = bb.`Month`
    AND
	aa.`Year` = bb.`Year`
LEFT JOIN
	(
		SELECT
			MONTH(DateOrdered) AS 'Month',
            YEAR(DateOrdered) AS 'Year',
			SUM(CodAmount) AS 'DailySales'
		FROM
			topyougo.orders
		WHERE
			DateOrdered = CURDATE()
		GROUP BY
			MONTH(DateOrdered),
			YEAR(DateOrdered)
    ) cc
ON
	aa.`Month` = cc.`Month`
    AND
	aa.`Year` = cc.`Year`
LEFT JOIN
	(
		SELECT
			MONTH(DateOrdered) AS 'Month',
            YEAR(DateOrdered) AS 'Year',
			COUNT(DISTINCT CONCAT(OrderNo, Product)) AS 'DailyOrders'
		FROM
			topyougo.orders
		WHERE
			DateOrdered = CURDATE()
		GROUP BY
			MONTH(DateOrdered),
			YEAR(DateOrdered)
    ) dd
ON
	aa.`Month` = dd.`Month`
    AND
	aa.`Year` = dd.`Year`
LEFT JOIN
	(
		SELECT
			MONTH(DateOrdered) AS 'Month',
            YEAR(DateOrdered) AS 'Year',
			SUM(CodAmount) AS 'ActualSales'
		FROM
			topyougo.orders
		WHERE
			MONTH(DateOrdered) = monthOrder
			AND
			YEAR(DateOrdered) = yearOrder
            AND
            OrderStatus = 'PAID'
		GROUP BY
			MONTH(DateOrdered),
			YEAR(DateOrdered)
    ) ee
ON
	aa.`Month` = ee.`Month`
    AND
	aa.`Year` = ee.`Year`
LEFT JOIN
	(
		SELECT
			MONTH(DateOrdered) AS 'Month',
            YEAR(DateOrdered) AS 'Year',
			SUM(CodAmount) AS 'TotalSales'
		FROM
			topyougo.orders
		WHERE
			MONTH(DateOrdered) = monthOrder
			AND
			YEAR(DateOrdered) = yearOrder
		GROUP BY
			MONTH(DateOrdered),
			YEAR(DateOrdered)
    ) ff
ON
	aa.`Month` = ff.`Month`
    AND
	aa.`Year` = ff.`Year`;

END */$$
